// Every user has its personal page where they can mange list of collections (create new, delete, or edit) â€” each collection in the list is a link to the collection page that contains table of items with sorting/filtering and capabilities to create new item, edit or delete existing item).
import { useEffect, useState } from "react";
import {
  Col,
  Container,
  Row,
  Card,
  Button,
  Form,
  InputGroup,
  FormControl,
  Dropdown,
  DropdownButton,
  Spinner,
} from "react-bootstrap";
import { Link } from "react-router-dom";
import { useDispatch, useSelector } from "react-redux";
import { getUserDetails, updateUserProfile } from "../Redux/Actions/UserActions";
import Error from "../components/ui/Error";
import UserProfileUpdate from "./UserProfileUpdate";

const UserPage = () => {
  const dispatch = useDispatch("");
  const [name, setName] = useState("");
  const [email, setEmail] = useState("");


  const userLogin = useSelector((state) => state.userLogin);
  const { userInfo } = userLogin;

  const userDetails = useSelector((state) => state.userDetails);
  const { error,loading,user } = userDetails;

  const userUpdateProfile = useSelector((state) => state.userUpdateProfile);
  const {loading: updatedLoading } = userUpdateProfile;

  useEffect(() => {
    if (user) {
      setName(user.name);
      setEmail(user.email);
    }
  }, [dispatch, user]);

  useEffect(() => {
    dispatch(getUserDetails("profile"));
  }, [dispatch]);




  return (
    <Container>
      <Row>
        <Col>
          <Button>Update Profile</Button>

          <Card>
          <Card.Title>Update Profile</Card.Title>
            {error && <Error variant={"alert-danger"}>{error}</Error>}
            {loading && <Spinner />}
            {updatedLoading && <Spinner />}
            <UserProfileUpdate/>


          </Card>
        </Col>
      </Row>
      <Row>
        <Col>
          <Card>
            <Card.Body>
              <Card.Title>The {userInfo.name}'s Collection List</Card.Title>
              <Link to="/collection">Collection Name 1(4)</Link>
              <Link to="/collection">Collection Name 2(4)</Link>
              <Link to="/collection">Collection Name3(4)</Link>
            </Card.Body>
          </Card>
        </Col>
      </Row>

      <Row>
        <Col>
          <InputGroup className="mb-3">
            <FormControl
              placeholder="filter"
              //   onChange={(event) => setSearchString(event.target.value)}
            />
            <DropdownButton title="Title">
              <Dropdown.Item>Item 1</Dropdown.Item>
            </DropdownButton>
            <DropdownButton title="Title">
              <Dropdown.Item>Item 2</Dropdown.Item>
            </DropdownButton>
          </InputGroup>
        </Col>
      </Row>

      <Row>
        <Col>
          <Button>Create New Collection</Button>
          <Card>
            <Card.Title>Create New Collection Form</Card.Title>
            <Form>
              <Form.Group className="mb-3">
                <Form.Label>Collection Name</Form.Label>

                <Form.Control
                  type="text"
                  required
                  id="title"
                  placeholder="Collection name"
                />
              </Form.Group>
              <Form.Group className="mb-3">
                <Form.Label>Collection Tag</Form.Label>
                <Form.Control
                  type="url"
                  required
                  id="tag"
                  placeholder="Select Tag"
                />
              </Form.Group>
              <Form.Group className="mb-3">
                <Form.Label>Collection topic</Form.Label>
                <Form.Control
                  rows={3}
                  type="text"
                  required
                  id="text"
                  placeholder="Collection Topic"
                />
              </Form.Group>
              <Button type="submit">Create Collection</Button>
            </Form>
          </Card>
        </Col>
      </Row>
    </Container>
  );
};

export default UserPage;
